import React from "react";

function Login() {
  return (
    <div>
      <form action="" class="form-box" method="POST">
        <h2 class="name">Chatzzz</h2>
        <label>
          Name:
          <input type="text" name="name" />
        </label>
        <input type="submit" value="Submit" />
        <div id="login">
          <a class="login-a" href="">
            Register
          </a>
        </div>
      </form>
    </div>
  );
}

export default Login;
